import React from 'react';
import './home.css' ;
function Home(){
    return(
        <div id="homePage-wrapper" >
            <div id="NavBar">
                <div id="nav-right">
                    <img src="assets/pixil-frame-0.png" id="logo" alt="logo"/>
                </div> 
                <div id="nav-left">
                    <a>Discover</a>
                    <a>Help</a>
                    <button>Sign In</button>
                </div>
            </div>
            <center><div id="line"><h1>Get Rewarded to SAVE!</h1>
                        <button id=''>Join Us</button>            
            </div></center>
            
        </div>
    )
}

export default Home;
